// src/pages/ProjectDescription.jsx
import React, { useState } from "react";
import "../styles/ProjectDescription.css";

// Banner just under the site header
import adBanner from "../assets/images/Advertisement1.png";

// Partner logos (same set/order as LandingPage)
import purdueLogo from "../assets/images/Purdue.png";
import tasiLogo from "../assets/images/TASI.png";
import toyotaLogo from "../assets/images/Toyota.png";
import csrcLogo from "../assets/images/CSRC.png";
import osuLogo from "../assets/images/OSU.png";
import eslLogo from "../assets/images/ESL.png";

/** Simple Accordion */
const Accordion = ({ title, children }) => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div className="accordion">
      <button
        className="accordion-header"
        aria-expanded={isOpen}
        onClick={() => setIsOpen((v) => !v)}
      >
        <span>{title}</span>
        <span className="accordion-icon">{isOpen ? "▲" : "▼"}</span>
      </button>
      {isOpen && <div className="accordion-content">{children}</div>}
    </div>
  );
};

const ProjectDescription = () => {
  return (
    <div className="project-description">
      {/* Advertisement directly below the global header */}
      <img src={adBanner} alt="Advertisement" className="ad-banner" />

      {/* Scroll hint */}
      <div className="scroll-hint">
        <span>Scroll for details</span>
        <div className="chevron">⌄</div>
      </div>

      {/* Title */}
      <h1 className="page-title">
        Purdue – OSU – Toyota Radar MicroDoppler Dataset
      </h1>

      {/* Centered Project Details (single column) */}
      <div className="content-container">
        <section className="right-accordions">
          <h2 style={{ textAlign: "center" }}>Project Details</h2>

          <Accordion title="Overview">
            <p>...</p>
          </Accordion>
          <Accordion title="Research Objective">
            <p>...</p>
          </Accordion>
          <Accordion title="Methodology">
            <p>...</p>
          </Accordion>
          <Accordion title="Key Findings">
            <p>...</p>
          </Accordion>
          <Accordion title="Impact and Applications">
            <p>...</p>
          </Accordion>
        </section>
      </div>

      {/* Logos — same style as Landing (brand-logos + logo-card) */}
      {/* Order:
          Row 1: Purdue, Toyota, OSU
          Row 2: TASI, CSRC, ESL */}
      <div className="brand-logos">
        {/* Row 1 */}
        <div className="logo-card">
          <img src={purdueLogo} alt="Purdue University" loading="lazy" />
        </div>
        <div className="logo-card">
          <img
            src={toyotaLogo}
            alt="Toyota Research & Development"
            loading="lazy"
          />
        </div>
        <div className="logo-card">
          <img src={osuLogo} alt="The Ohio State University" loading="lazy" />
        </div>

        {/* Row 2 */}
        <div className="logo-card">
          <img
            src={tasiLogo}
            alt="Transportation & Autonomous Systems Initiative (TASI)"
            loading="lazy"
          />
        </div>
        <div className="logo-card">
          <img
            src={csrcLogo}
            alt="Toyota Collaborative Safety Research Center (CSRC)"
            loading="lazy"
          />
        </div>
        <div className="logo-card">
          <img
            src={eslLogo}
            alt="ElectroScience Laboratory (ESL)"
            loading="lazy"
          />
        </div>
      </div>

      
    </div>
  );
};

export default ProjectDescription;
